import React from 'react';
import Ship from '../Media/Ship.svg';

export const Delivery = () => {
  return (
    <div className="delivery">
    <img className="delivery_image" src={Ship} />
    <div className="delivery_cta">
      <h2 className="delivery_headline">Free Shipping All Over India</h2>
      <p className="delivery_p">
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Veritatis rem nam cumque delectus dolorum quaerat nesciunt in, quis modi aliquid, sed, minima consequuntur quas minus!
      </p>
      <div className="delivery_buttons">
        <button type="button" className="btn btn-primary btn-lg px-4 me-md-2">
          Send Gift Now!
        </button>
      </div>
    </div>
  </div>
  )
}
